import React, { Component } from "react";

import { useMediaQuery } from 'react-responsive'



export default class Body extends Component {

  render() {

    const isDesktopOrLaptop = useMediaQuery(
      { minDeviceWidth: 1224 },
      { deviceWidth: 1600 } // `device` prop

    )

    const isTabletOrMobile = useMediaQuery({ maxWidth: 600 })

    const fiftyFifty = {
      width: '50%',
      marginTop: "0px",
      height: "300px",



    }

    const fiftyFiftyResize = {
      width: '50%',
      marginTop: "0px",
      height: "20%",



    }
    const fifteen = {
      width: '15%',
      marginTop: "100px",
      height: "300px"
    }
    const fifty = {
      width: '50%',
      marginTop: "0px",
      height: "300px"
    }
    const twentyFive = {
      width: '25%',
      marginTop: "0px",
      height: "300px"
    }

    const seventy = {
      marginTop: "100px",
      width: '70%',
      height: "300px"
    }

    return (
      <div className="body resize">
        <img
          className='resize'
          alt="Mother of all Lies"
          style={fifteen}
          src={require("../images/mother.png")}
        />
        <img
          className="resize"
          alt="Blue Hour"
          style={fifteen}
          src={require("../images/bluehour.png")}
        />
        <img
          className="resize"
          alt="Curse of Oak Island"
          style={seventy}
          src={require("../images/curse.png")}
        />
        <img
          className="resize"
          alt="Pitbulls and Parolees"
          style={twentyFive}
          src={require("../images/pitbulls.png")}
        />
        <img
          className="resize"
          alt="Killer Kids"
          style={fifty}
          src={require("../images/killerKids.png")}
        />
        <img
          className="resize"
          alt="Night Watch"
          style={twentyFive}
          src={require("../images/nightwatch.png")}
        />
        <img
          className="resize"
          alt="All Summer in a Day"
          style={fiftyFifty}
          src={require("../images/allSummer.png")}
        />
        <img
          className="resize"
          alt="Winter Chemistry"
          style={fiftyFifty}
          src={require("../images/winter.png")}
        />

        {isTabletOrMobile &&
          <div>
            <img
              className="resize"
              alt="All Summer in a Day"
              style={fiftyFiftyResize}
              src={require("../images/allSummer.png")}
            />
            <img
              className="resize"
              alt="Winter Chemistry"
              style={fiftyFiftyResize}
              src={require("../images/winter.png")}
            />
          </div>
        }



      </div>
    );
  }
}
